import './App.css';
import { Route, BrowserRouter as Router } from 'react-router-dom';
import DogList from './components/DogList';
import Routes from './Routes';

function App() {
  return (
    <Router>
    <div className="App">
      <h1>Good luck!</h1>
      <Routes>
        <Route exact path="/dogs" component={DogList} />
      </Routes>
    </div>
    </Router>
  );
}

export default App;
